	//cookie**sCookie
	u.setCookie=function(key,val,time){
        var date=new Date(); //
        var expiresDays=time;  //daten
        date.setTime(date.getTime()+expiresDays*24*3600*1000); //cookie
        document.cookie=key + "=" + val +";expires="+date.toGMTString();  //cookie
	}
	//Cookie
	u.getCookie=function(key){
		var getCookie = document.cookie.replace(/[ ]/g,"");  //cookiecookie
        var arrCookie = getCookie.split(";")  //cookie"" cookiearrCookie
        var tips;  //tips
        for(var i=0;i<arrCookie.length;i++){   //forcookietips
            var arr=arrCookie[i].split("=");   //cookie""cookiearr
            if(key==arr[0]){  //arr[0]cookietips
                tips=arr[1];   //cookietips
                break;   //for
            }
        }
        return tips;
	}
	//Cookie
	u.removeCookie=function(key){
		var date = new Date(); //
        date.setTime(date.getTime()-10000); //date
        document.cookie = key + "=v; expires =" +date.toGMTString();//cookie
	}
	//url
	u.getWindowUrl=function(){
		var urlParameterObj = new Object();
		var windowUrl = window.location.href.split('?')[1];//
		if(windowUrl.split('=').length > 2 ){//
			var parameterList = windowUrl.split('&');
			for(let i in parameterList){
				urlParameterObj[parameterList[i].split('=')[0]] = parameterList[i].split('=')[1];
			}
			return urlParameterObj;
		}else{//
			urlParameterObj[windowUrl.split('=')[0]] = windowUrl.split('=')[1]
			return urlParameterObj;
		}
	}
